import React, { Component } from "react";
import { imagesHead } from "../helpers/imagesHead";

import humboldt from "../images/Principal_Page/01.head/humboldt.jpg";
import itm from "../images/Principal_Page/01.head/logo-del-itm.jpg";
import udea from "../images/Principal_Page/01.head/udea.jpg";

class Head extends Component {
  render() {
    return (
      <div className="flex h-48 bg-white items-center w-screen justify-center">
        <div className="ml-96 mr-20 w-51.5 bg-gray-900 h-22.5">    
        </div>
        <div className="h-22.25 mr-20 w-51.5 ">
            <img src={imagesHead('./logo-de-la-udea.jpg')} alt=""/>
        </div>
        <div className="h-22.5 mr-20 w-89.25 ">
        <img src={udea} alt=""/>
        </div>
        <div className="h-22.5 mr-96 w-21 ">
        <img src={humboldt} alt=""/>
        </div>
      </div>
    );
  }
}

export default Head;
